import React, { Component } from 'react'
import './navbar.css';
import Logo from '../logo/Logo';

export class Navbar extends Component {

    render() {

    return (
        <React.Fragment>
            <nav className='nav'>
                <div className='logo'>
                    <a alt='logo-link' href='/'> 
                        <Logo />
                    </a> 
                </div>
                <div>
                    <ul className='nav-links-list'>
                        <li className='nav-link-list-item' id='first-item'><a alt='home' href='/'>Home</a></li>
                        <li className='nav-link-list-item'><a alt='about' href='/about'>About</a></li>
                        <li className='nav-link-list-item'><a alt='home' href='/carwash'>Service</a></li>
                        <li className='nav-link-list-item'><a alt='about' href='/cleaning'>Contact</a></li>
                    </ul>
                </div>
{/*                 
                <div className='nav-burger'>
                    <i className="fas fa-bars fa-2x nav-menu"></i>
                </div> */}
            </nav>
        </React.Fragment>
    )
    }
}

export default Navbar;
